define({"topics":[{"title":"Connect an <span class=\"ph\">Airwall Gateway<\/span> with Diag mode","shortdesc":"<p class=\"shortdesc\">You can manually point an <span class=\"ph\">Airwall Gateway<\/span> to the <span class=\"ph\">Conductor<\/span> URL, depending         on your model. <\/p>","href":"content\/topics\/hip_manual_connect.html","attributes":{"data-id":"hip_manual_connect"},"menu":{"hasChildren":false},"tocID":"hip_manual_connect-d8884e8470","topics":[]},{"title":"Connect to a physical <span class=\"ph\">Airwall Gateway<\/span> or <span class=\"ph\">Conductor<\/span> with a console port","shortdesc":"<p class=\"shortdesc\">If your physical  <span class=\"ph\">Airwall Gateway<\/span> or <span class=\"ph\">Conductor<\/span> is equipped         with a console port (or your cloud or virtual provider allows console access), you can         configure the <span class=\"ph\">Conductor<\/span>         URL and other options using a computer connected to the console port using             <kbd class=\"ph userinput\">airsh<\/kbd> commands. <\/p>","href":"content\/topics\/hip_manual_connect_console.html","attributes":{"data-id":"hip_manual_connect"},"menu":{"hasChildren":false},"tocID":"hip_manual_connect-d8884e8504","topics":[]},{"title":"Connect an <span class=\"ph\">Airwall Gateway<\/span> with a DNS SRV record","shortdesc":"<p class=\"shortdesc\">You can connect an <span class=\"ph\">Airwall Gateway<\/span> to the <span class=\"ph\">Conductor<\/span> by using a DNS SRV   record.<\/p>","href":"content\/topics\/HIPswitch_dns_connect.html","attributes":{"data-id":"HIPswitch_dns_connect"},"menu":{"hasChildren":false},"tocID":"HIPswitch_dns_connect-d8884e8547","topics":[]},{"title":"Connect an <span class=\"ph\">Airwall Gateway<\/span> by using a factory-configured URL","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">Tempered<\/span> can         pre-configure the <span class=\"ph\">Conductor<\/span> URL for each             <span class=\"ph\">Airwall Gateway<\/span>. <span class=\"ph\">Airwall Gateways<\/span> configured with         DNS require the user to configure the DNS service to resolve the correct IP address for the             <span class=\"ph\">Conductor<\/span> hostname         based on the factory-configured URL.<\/p>","href":"content\/topics\/hip_factory_connect.html","attributes":{"data-id":"hip_factory_connect"},"menu":{"hasChildren":false},"tocID":"hip_factory_connect-d8884e8581","topics":[]},{"title":"Check if an <span class=\"ph\">Airwall Gateway<\/span> or <span class=\"ph\">Airwall Agent<\/span> is online","shortdesc":"<p class=\"shortdesc\">Once an <span class=\"ph\">Airwall Edge Service<\/span>     is connected to the <span class=\"ph\">Conductor<\/span> and licensed, you can validate that it is online.<\/p>","href":"content\/topics\/hip_check_online.html","attributes":{"data-id":"hip_check_online"},"menu":{"hasChildren":false},"tocID":"hip_check_online-d8884e8623","topics":[]}]});